	<p>–ü–∞–ª—ñ—Ü–∏–Ω–∞ —É ‚Äî—Ö —Ä—Ä. –π —Ä–µ–∫–æ–Ω—Å—Ç—Ä—É–π–æ–≤–∞–Ω–∏–π –ö. –®–æ–ª—å—Ü–µ–º —É ‚Äî—Ö —Ä—Ä. –≤ —Å—Ç–∏–ª—å–æ–≤–∏—Ö —Ñ–æ—Ä–º–∞—Ö –∞–Ω–≥–ª—ñ–π—Å—å–∫–æ—ó –Ω–µ–æ–≥–æ—Ç–∏–∫–∏. –†–æ–∑–ø–ª–∞–Ω—É–≤–∞–ª—å–Ω–æ –±—É–¥–∏–Ω–æ–∫ –ø–æ–¥—ñ–ª—è—î—Ç—å—Å—è. –ù–∞ –≤—Å—ñ—Ö —Ñ–∞—Å–∞–¥–∞—Ö —î –≤–∏—Å—Ç—É–ø–∏ —É –≤–∏–≥–ª—è–¥—ñ –≥—Ä–∞–Ω—á–∞—Å—Ç–∏—Ö –µ—Ä–∫–µ—Ä—ñ–≤, —Ä–∏–∑–∞–ª—ñ—Ç—ñ–≤ —á–∏ –≤–µ–∂. –ù–∞–≥–æ—Ä—ñ –≤–ª–∞—à—Ç–æ–≤–∞–Ω–æ –æ–≥–ª—è–¥–æ–≤–∏–π –º–∞–π–¥–∞–Ω—á–∏–∫. –°–∞–¥–∏–±–Ω–∏–π –∫–æ–º–ø–ª–µ–∫—Å —É –ë–∞—Å–∞—Ö —î –æ–¥–Ω–∏–º —ñ–∑ –º–∏—Å—Ç–µ—Ü—å–∫–∏ –Ω–∞–π–¥–æ–≤–µ—Ä—à–µ–Ω—ñ—à–∏—Ö —Å–µ—Ä–µ–¥ —Ç–∏—Ö, —â–æ –∑–±–µ—Ä–µ–≥–ª–∏—Å—è –Ω–∞ –°–ª–æ–±–æ–∂–∞–Ω—â–∏–Ω—ñ.</p>
<p>–¶–µ —Ä—ñ–¥–∫—ñ—Å–Ω–∏–π –∞–≤—Ç–æ—Ä—Å—å–∫–∏–π –≤–∏—Ç–≤—ñ—Ä –∞—Ä—Ö—ñ—Ç–µ–∫—Ç–æ—Ä–∞ –û. –ó–∞–ø–∏—Å–∫–∏ –í. –õ—É–∫–æ–º—Å–∫–∏–π –ì. –ß–µ—Ä–∫–∞—Å–æ–≤–∞ –ï. –¢–≤–æ—Ä—á–µ—Å—Ç–≤–æ –ê. –ß–µ—Ä–∫–∞—Å–æ–≤–∞ –ö. –°–æ–±–æ—Ä–Ω–∞, 31 , —Ç–∞–∫, —â–æ —Å–æ–±–æ—Ä–Ω–∞ –¥–∑–≤—ñ–Ω–∏—Ü—è –≤–∏—Ö–æ–¥–∏—Ç—å –Ω–∞ —á–µ—Ä–≤–æ–Ω—É –ª—ñ–Ω—ñ—é –∑–∞–±—É–¥–æ–≤–∏. –ú—ñ—Å—Ç–∏—Ç—å—Å—è –Ω–∞ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó –∫–æ–ª–∏—à–Ω—å–æ—ó —Ñ–æ—Ä—Ç–µ—Ü—ñ, –∑–∞—Å–Ω–æ–≤–∞–Ω–æ—ó –±–ª–∏–∑—å–∫–æ ‚Äî —Ä—Ä. –°–ø–æ—Ä—É–¥–∞ —î –≥–æ–ª–æ–≤–Ω–æ—é –º—ñ—Å—Ç–æ–±—É–¥—ñ–≤–Ω–æ—é –¥–æ–º—ñ–Ω–∞–Ω—Ç–æ—é –º. –°–æ–±–æ—Ä–Ω–æ—ó —Ç–∞ –ø—Ä–∏–ª–µ–≥–ª–∏—Ö –ø—Ä–æ—Å—Ç–æ—Ä—ñ–≤ –∑–∞–ø–ª–∞–≤–∏ —Ä. –ü—Å—å–æ–ª, —Ç–∞–∫ —ñ –∑ –¥–∞–ª–µ–∫–∏—Ö –≤—ñ–¥—Å—Ç–∞–Ω–µ–π. –¢–µ—Ä–∏—Ç–æ—Ä—ñ—è –°–ø–∞—Å–æ‚Äî–ü—Ä–µ–æ–±—Ä–∞–∂–µ–Ω—Å—å–∫–æ–≥–æ —Å–æ–±–æ—Ä—É –≤ —Å—Ç—Ä—É–∫—Ç—É—Ä—ñ –∑–∞–±—É–¥–æ–≤–∏ —ñ—Å—Ç–æ—Ä–∏—á–Ω–æ–≥–æ —Å–µ—Ä–µ–¥–º—ñ—Å—Ç—è. –ì–µ–Ω–µ—Ä–∞–ª—å–Ω–∏–π –ø–ª–∞–Ω. –ö—Ä–µ—Å–ª–µ–Ω–∏–∫ –∞–≤—Ç–æ—Ä–∞. –Ü–∫–æ–Ω–æ—Å—Ç–∞—Å –±—ñ—á–Ω–æ–≥–æ –≤—ñ–≤—Ç–∞—Ä—è —Å–æ–±–æ—Ä—É.</p>
<p>–§–æ—Ç–æ –û. –¶—è —Ü–µ—Ä–∫–≤–∞ –∑–≥–æ—Ä—ñ–ª–∞ —É —Ä. –ú—É—Ä–æ–≤–∞–Ω–∏–π —Å–æ–±–æ—Ä –∑–∞—Å–Ω–æ–≤–∞–Ω–æ —Ä. –π –æ—Å–≤—è—á–µ–Ω–æ —Ä. –ó–±—É–¥–æ–≤–∞–Ω–æ –∫–æ—à—Ç–æ–º –Ø–∫–æ–≤–∞ –®—É–±—Å—å–∫–æ–≥–æ, –Ñ–≤–¥–æ–∫—ñ—ó –ü–∞—Ä–∞—Ñ—ñ—î–≤—Å—å–∫–æ—ó —Ç–∞ –§–µ–¥–æ—Ä–∞ –§—ñ–ª–æ–Ω–µ–Ω–∫–∞. –ü—Ä–æ—Ç–µ —Ä. —ó—ó —Ä–æ–∑—ñ–±—Ä–∞–ª–∏, –æ—Å–∫—ñ–ª—å–∫–∏ –≤–æ–Ω–∞ –æ–ø–∏–Ω–∏–ª–∞—Å—è –≤ –∞–≤–∞—Ä—ñ–π–Ω–æ–º—É —Å—Ç–∞–Ω—ñ. –°–æ–±–æ—Ä –ø–µ—Ä–µ–±—É–¥–æ–≤–∞–Ω–æ –≤ —Ä. –¥–∑–≤—ñ–Ω–∏—Ü—ñ –∑–∞–≤–≤–∏—à–∫–∏ 56 –º. –£ —Å—Ö—ñ–¥–Ω—ñ–π —á–∞—Å—Ç–∏–Ω—ñ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ—ó —Å–æ–±–æ—Ä—É –≤ —Ä.</p><strong><a id='g3'></a><h2>–û—Ö—Ç–∏—Ä–∫–∞ | –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ üíó | –°—É–º—Å—å–∫–∞ –æ–±–ª–∞—Å—Ç—å ‚Äî mistaUA</h2></strong><p>–∑–∞ –ø—Ä–æ–µ–∫—Ç–æ–º –º—ñ—Å—Ü–µ–≤–æ–≥–æ –∞—Ä—Ö—ñ—Ç–µ–∫—Ç–æ—Ä–∞ –ì—Ä–∏–≥–æ—Ä—ñ—è –§–µ–¥–æ—Ä–æ–≤–∏—á–∞ –ü—Ä—è–¥–∫—ñ–Ω–∞ –∑–±—É–¥–æ–≤–∞–Ω–æ –º—É—Ä–æ–≤–∞–Ω—É –æ–¥–Ω–æ–ø–æ–≤–µ—Ä—Ö–æ–≤—É –±—É–¥—ñ–≤–ª—é —Ü–µ—Ä–∫–æ–≤–Ω–æ‚Äî–ø–∞—Ä–∞—Ñ—ñ—è–ª—å–Ω–æ—ó —à–∫–æ–ª–∏. –°–æ–±–æ—Ä ‚Äî –æ–¥–Ω–æ–±–∞–Ω–µ–≤–∏–π, —Ö—Ä–µ—â–∞—Ç–∏–π —É –ø–ª–∞–Ω—ñ, –≤–∏–¥–æ–≤–∂–µ–Ω–∏–π –≤–∑–¥–æ–≤–∂ –≤—ñ—Å—ñ –∑–∞—Ö—ñ–¥‚Äî—Å—Ö—ñ–¥, –∑ –º–∞—Å–∏–≤–Ω–æ—é –ø—ñ–≤–∫—Ä—É–≥–ª–æ—é –∞–ø—Å–∏–¥–æ—é, –æ—Ç–æ—á–µ–Ω–æ—é –Ω–∏–∑–µ–Ω—å–∫–æ—é –æ–±—Ö—ñ–¥–Ω–æ—é –≥–∞–ª–µ—Ä–µ—î—é. –ë—ñ—á–Ω—ñ —Ä–∞–º–µ–Ω–∞ –ø–µ—Ä–µ–∫—Ä–∏—Ç—ñ –∑—ñ–º–∫–Ω–µ–Ω–∏–º–∏ —Å–∫–ª–µ–ø—ñ–Ω–Ω—è–º–∏. –ù–∏–∂–Ω—ñ –∫–æ–ª–æ–Ω–∏ –∫–æ—Ä–∏–Ω—Ñ—Å—å–∫–æ–≥–æ –æ—Ä–¥–µ—Ä–∞, –≤–µ—Ä—Ö–Ω—ñ ‚Äî —ñ–æ–Ω—ñ—á–Ω–æ–≥–æ. –¢–∏–º–ø–∞–Ω–∏ —Ç—Ä–∏–∫—É—Ç–Ω–∏—Ö —Ñ—Ä–æ–Ω—Ç–æ–Ω—ñ–≤ –ø–æ–∫—Ä–∏—Ç—ñ –æ—Ä–Ω–∞–º–µ–Ω—Ç–∞–ª—å–Ω–∏–º –ª—ñ–ø–ª–µ–Ω–Ω—è–º —Ä–æ—Å–ª–∏–Ω–Ω–æ–≥–æ —Ö–∞—Ä–∞–∫—Ç–µ—Ä—É.</p>
<p>–ë—ñ–ª—è –æ—Å–Ω–æ–≤–∏ –ø—ñ–¥–±–∞–Ω–Ω–∏–∫–∞, –æ—Ç–æ—á–µ–Ω–æ–≥–æ —Å–ø–∞—Ä–µ–Ω–∏–º–∏ –∫–æ–ª–æ–Ω–∞–º–∏ –∫–æ—Ä–∏–Ω—Ñ—Å—å–∫–æ–≥–æ –æ—Ä–¥–µ—Ä–∞, –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ —á–∞–≤—É–Ω–Ω—ñ —Å—Ç–∞—Ç—É—ó –∞–ø–æ—Å—Ç–æ–ª—ñ–≤ –ü–µ—Ç—Ä–∞, –Ü–æ–∞–Ω–∞, –Ø–∫–æ–≤–∞ –π –ê–Ω–¥—Ä—ñ—è. –í–µ—Ä—Ö–Ω—ñ —è—Ä—É—Å–∏ –¥–∑–≤—ñ–Ω–∏—Ü—ñ –∑ –∞—Ä–∫–æ–≤–∏–º–∏ –≤–∏—Ä—ñ–∑–∞–º–∏ –¥–ª—è –¥–∑–≤–æ–Ω—ñ–≤. –í—ñ–Ω—á–∞—î –¥–∑–≤—ñ–Ω–∏—Ü—é –ø–ª–µ—Å–∫–∞—Ç–∞ –ø–æ–∑–æ–ª–æ—á–µ–Ω–∞ –±–∞–Ω—è –∑ –º–∞–∫—ñ–≤–∫–æ—é. –ù–∏–∂–Ω—ñ–π —è—Ä—É—Å –¥–∑–≤—ñ–Ω–∏—Ü—ñ —Å–ª—É–≥—É—î –≥–æ–ª–æ–≤–Ω–∏–º –≤—Ö–æ–¥–æ–º –¥–æ —Ö—Ä–∞–º—É. –®—ñ—Å—Ç—å –∫–æ–ª–æ–Ω –≥–æ–ª–æ–≤–Ω–æ–≥–æ —ñ–∫–æ–Ω–æ—Å—Ç–∞—Å–∞ –∑—Ä–æ–±–ª–µ–Ω–æ –∑ –º–∞–ª–∞—Ö—ñ—Ç—É. –õ–µ–≤–∏—Ç—Å–∫–∏–π –ò. –ò—Å—Ç–æ—Ä–∏—á–µ—Å–∫–æ–µ –ø—Ä–æ—à–ª–æ–µ –≥. –¢–µ–∞—Ç—Ä –¥—Ä–∞–º–∏ —ñ –º—É–∑–∏—á–Ω–æ—ó –∫–æ–º–µ–¥—ñ—ó —ñ–º.</p>
		
