	<p>–©–µ–ø–∫—ñ–Ω–∞ –ú–æ–Ω—É–º–µ–Ω—Ç–∞–ª—å–Ω–∞ —Å–ø–æ—Ä—É–¥–∞ —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω–∞ –≤ —Å–µ—Ä–µ–¥–º—ñ—Å—Ç—ñ –ø–æ—Å–µ—Ä–µ–¥ –ø—Ä—è–º–æ–∫—É—Ç–Ω–æ–≥–æ –º–∞–π–¥–∞–Ω—É, —â–æ –±—É–≤ —É—Ç–≤–æ—Ä–µ–Ω–∏–π —à–ª—è—Ö–æ–º –∑–Ω–µ—Å–µ–Ω–Ω—è –∫–≤–∞—Ä—Ç–∞–ª—ñ–≤ —ñ—Å—Ç–æ—Ä–∏—á–Ω–æ—ó –∑–∞–±—É–¥–æ–≤–∏ –¢–µ–∞—Ç—Ä–∞–ª—å–Ω–∞ –ø–ª–æ—â–∞, 1. –°—Ç–æ—ó—Ç—å –Ω–∞ –∫—Ä–∞—é –ø—ñ–¥–≤–∏—â–µ–Ω–æ–≥–æ –ø—Ä–∞–≤–æ–≥–æ –±–µ—Ä–µ–≥–∞ —Ä. –ö–æ–º–ø–æ–∑–∏—Ü—ñ–π–Ω–æ —î –ª–∞–Ω–∫–æ—é, —â–æ –ø–æ—î–¥–Ω—É—î –ª–∞–Ω–¥—à–∞—Ñ—Ç–Ω–∏–π –ø–∞—Ä–∫ —É –∑–∞–ø–ª–∞–≤—ñ –∑ —Ü–µ–Ω—Ç—Ä–∞–ª—å–Ω–∏–º —ñ—Å—Ç–æ—Ä–∏—á–Ω–∏–º –º–∞–π–¥–∞–Ω–æ–º –º—ñ—Å—Ç–∞ ‚Äî –ö—Ä–∞—Å–Ω–∏–º.</p><strong><a id='g4'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –û—Ö—Ç–∏—Ä–∫–∞</h2></strong><p>–¢–µ–∞—Ç—Ä –∑–±—É–¥–æ–≤–∞–Ω–æ —Ä. –Ü–Ω—Ç–µ—Ä'—î—Ä —Ñ–æ–π—î –¥—Ä—É–≥–æ–≥–æ –ø–æ–≤–µ—Ä—Ö—É –ö–∏—ó–≤ —É —Å–∫–ª–∞–¥—ñ –∞—Ä—Ö—ñ—Ç–µ–∫—Ç–æ—Ä—ñ–≤ –°. –°–ª—ñ–ø—Ü—è, –ê. –ü–µ—Ç—Ä–æ–≤–æ—ó, –∞ —Ç–∞–∫–æ–∂ –º–∏—Ç—Ü—ñ–≤ –í. –ó–∞—Ä–µ—Ü—å–∫–æ–≥–æ, –ú. –®–µ–≤—á–µ–Ω–∫–∞, –í. –Ñ—Ä–º–æ–ª–µ–Ω–∫–∞ —Ç–∞ —ñ–Ω—à–∏—Ö. –∞–≤—Ç–æ—Ä–∞–º —Ç–µ–∞—Ç—Ä—É –±—É–ª–æ –ø—Ä–∏—Å—É–¥–∂–µ–Ω–æ –î–µ—Ä–∂–∞–≤–Ω—É –ø—Ä–µ–º—ñ—é –£–†–°–† —ñ–º. –ö–æ–º–ø–æ–∑–∏—Ü—ñ–π–Ω–æ—é –≤—ñ—Å—Å—é –º–∞–π–¥–∞–Ω—É —î —à–∏—Ä–æ–∫–∞ –∞–ª–µ—è, –ø—Ä–∏–∫—Ä–∞—à–µ–Ω–∞ –±–∞—Å–µ–π–Ω–∞–º–∏ –∑ –≤–æ–¥–æ–≥—Ä–∞—è–º–∏ –π –ø–∞—Ä—Ç–µ—Ä–Ω–æ—é –∑–µ–ª–µ–Ω–Ω—é, —â–æ –≤–µ–¥–µ –¥–æ –≥–æ–ª–æ–≤–Ω–æ–≥–æ –≤—Ö–æ–¥—É –≤ —Ç–µ–∞—Ç—Ä. –ó –∑–∞—Ö—ñ–¥–Ω–æ–≥–æ –±–æ–∫—É –≥–∞—Ä–¥–µ—Ä–æ–±–∞, –∑–≤–µ—Ä–Ω–µ–Ω–æ–≥–æ –≤ –±—ñ–∫ –º—ñ—Å—Ç–∞, —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω–æ –∫–∞—Å–æ–≤–∏–π –∑–∞–ª, –∞ —Å–∏–º–µ—Ç—Ä–∏—á–Ω–æ –π–æ–º—É –∑ –±–æ–∫—É –ø–∞—Ä–∫—É ‚Äî –∑–∞–ª –¥–ª—è –∫—É—Ä—Ü—ñ–≤.</p>
